const NavbarComponent = () => {
    return (
        <>
        <nav>
            Dodo 
            <a href='https://www.google.com'>Prueba 1</a>
            <a href='https://www.yahoo.com'>Prueba 2</a>
        </nav> 
        </>
    );
}

export default NavbarComponent;
